import React from 'react'

function Footer() {
    return (
        <footer>
            <h4>My Information</h4>
            <ul>
                <li>Github <span className="link"><a href="https://github.com/stevenrichter16/Portfolio">https://github.com/stevenrichter16/Portfolio</a></span></li>
                <li>LinkedIn <span className="link"><a href="www.linkedin.com/in/stevenrichter16">www.linkedin.com/in/stevenrichter16</a></span></li>
                <li>Email <span className="link">stevenrichter16@gmail.com</span></li>
            </ul>
        </footer>         
    )
}

export default Footer;
